import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "bananas",
      amount: 1.42,
      date: new Date(2022, 6, 1),
    },
    {
      id: "e2",
      title: "deoderant",
      amount: 3.52,
      date: new Date(2022, 6, 5),
    },
    {
      id: "e3",
      title: "rent",
      amount: 905.0,
      date: new Date(2022, 7, 1),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
